n.\nDie folgende Funktion gewhrleistet, dass die Datenbank richtig eingerichtet ist.\nDie Datenbanknderungen, die in diesem Schritt durchgefhrt werden, beeintrchtigen den Rest der MediaWiki-Datenbank nicht. Sie knnen, sofern dies gewnscht ist, leicht rckgngig gemacht werden.\nDiese Einrichtungsfunktion kann mehrere Male ausgefhrt werden, ohne Schaden zu verursachen. Sie braucht allerdings nur einmal, whrend der Installation oder Aktualisierung von Semantic MediaWiki, durchgefhrt werden.\";'),('de','messages:smw_smwadmin_permissionswarn','s:600:\"Sofern diese Aktion mit einem SQL-Fehler abbricht, knnte es sein, dass der Datenbankbenutzer, mit dem das Wiki auf die Datenbank zugreift (siehe die Datei LocalSettings.php), ber keine ausreichenden Rechte verfgt.\nUm das Problem zu beheben, ist es notwendig, entweder dem Benutzer zustzliche Rechte zur Erstellung und Lschung von Datenbanktabellen einzurumen, den Datenbankadministrator zeitweilig in die Datei LocalSettings.php einzutragen, oder aber das Wartungsskript <tt>SMW_setup.php</tt> zu nutzen, das von einem Servernutzer mit Administrationsberechtigung ausgefhrt werden kann.\";'),('de','messages:smw_smwadmin_dbbutton','s:42:\"Tabellen initialisieren oder aktualisieren\";'),('de','messages:smw_smwadmin_announce','s:18:\"Wiki bekannt geben\";'),('de','messages:smw_smwadmin_announcedocu','s:579:\"Semantic MediaWiki bietet einen Webservice zur Bekanntgabe neuer semantischer Wikis.\nDieser Service wird genutzt, um eine Liste aller ffentlich zugnglichen Wikis zu erhalten, die Semantic MediaWiki verwenden. Er dient aber auch dazu, dem <a href=\"http://semantic-mediawiki.org/wiki/SMW_Project\">Semantic MediaWiki-Projekt</a> einen berblick ber typische Anwendungen von Semantic MediaWiki zu ermglichen.\nSiehe hierzu die Website von Semantic MediaWiki fr <a href=\"http://semantic-mediawiki.org/wiki/Registry\">weiterfhrende Informationen zu diesem Service</a>.\";'),('de','messages:smw_smwadmin_announcebutton','s:251:\"Bitte die folgende Schaltflche anklicken, um dem Verzeichnisdienst die URL dieses Wikis hinzuzufgen.\nEs werden dabei nur ffentlich zugngliche Informationen gespeichert. Es werden keine Wikis aufgenommen, die nicht ffentlich zugnglich sind.\";'),('de','messages:smw_smwadmin_datarefresh','s:35:\"Datenreparatur oder -aktualisierung\";'),('de','messages:smw_smwadmin_datarefreshdocu','s:614:\"Es ist mglich alle Datenbanken von Semantic MediaWiki auf Basis des aktuellen Inhalts des Wikis wiederherzustellen.\nDies kann hilfreich sein, um eine fehlerhafte Datenbank zu erneuern oder um Daten zu aktualisieren, sofern bspw. aufgrund einer Softwareaktualisierung die Datenbankstruktur gendert wurde.\nDie Datenaktualisierung wird fr jede Seite ausgefhrt und daher einige Zeit in Anspruch nehmen.\nNachfolgend wird angezeigt, ob eine momentan Aktualisierung luft bzw. ermglicht es eine Aktualisierung zu starten oder zu stoppen (sofern diese Funktion nicht vom Websiteadministrator deaktiviert wurde).\";'),('de','messages:smw_smwadmin_datarefreshprogress','s:659:\"<strong>Eine Aktualisierung wird bereits durchgefhrt.</strong>\nEine Aktualisierung geht normalerweise nur langsam voran, da die Daten lediglich in kleinen Schritten erneuert werden, und zwar jedes Mal, wenn ein Benutzer auf das Wiki zugreift.\nUm diese Aktualisierung schneller zu Ende zu fhren, kann man das MediaWiki-Wartungsskript <tt>runJobs.php</tt> einsetzen. Mit dem Parameter <tt>--maxjobs 1000</tt> beschrnkt man dabei die Anzahl der Aktualisierungsschritte, die in einem Durchgang durchgefhrt werden, um Probleme bei der Nutzung des hierfr erforderlichen Arbeitsspeichers zu vermeiden.\nGeschtzter Fortschritt der laufenden Aktualisierung:\";'),('de','messages:smw_smwadmin_datarefreshbutton','s:27:\"Datenaktualisierung starten\";'),('de','messages:smw_smwadmin_datarefreshstop','s:33:\"Diese Datenaktualisierung beenden\";'),('de','messages:smw_smwadmin_datarefreshstopconfirm','s:23:\"Ja, ich bin mir sicher.\";'),('de','messages:smw_smwadmin_support','s:23:\"Untersttzung erhalten\";'),('de','messages:smw_smwadmin_supportdocu','s:63:\"Verschiedene Hinweise helfen vielleicht im Fall eines Problems:\";'),('de','messages:smw_smwadmin_installfile','s:213:\"Sofern es Probleme mit der Installation gibt, knnte die Datei <a href=\"https://gerrit.wikimedia.org/r/gitweb?p=mediawiki/extensions/SemanticMediaWiki.git;a=blob_plain;f=INSTALL;hb=HEAD\">INSTALL</a> weiterhelfen.\";'),('de','messages:smw_smwadmin_smwhomepage','s:195:\"Die komplette Nutzerdokumentation von Semantic MediaWiki ist auf <b><a href=\"http://semantic-mediawiki.org/wiki/Semantic_MediaWiki_%E2%80%93_Startseite\">semantic-mediawiki.org</a></b> verfgbar.\";'),('de','messages:smw_smwadmin_mediazilla','s:91:\"Fehler knnen bei <a href=\"https://bugzilla.wikimedia.org/\">Bugzilla</a> berichtet werden.\";'),('de','messages:smw_smwadmin_questions','s:214:\"Im Fall weiterer Fragen oder Anregungen kann man sich an den Diskussionen im <a href=\"http://sourceforge.net/mailarchive/forum.php?forum_name=semediawiki-user\">Semantic MediaWiki-Benutzerforum</a> beteiligen.\";'),('de','messages:smw_adminlinks_datastructure','s:13:\"Datenstruktur\";'),('de','messages:smw_adminlinks_displayingdata','s:12:\"Datenanzeige\";'),('de','messages:smw_adminlinks_inlinequerieshelp','s:31:\"Hilfe zu eingebetteten Abfragen\";'),('de','messages:smw-createproperty-isproperty','s:39:\"Dies ist ein Attribut des Datentyps $1.\";'),('de','messages:smw-createproperty-allowedvals','s:105:\"{{PLURAL:$1|Der mgliche Wert fr dieses Attribut ist|Die mglichen Werte fr dieses Attribut sind}}:\";'),('de','messages:smw-paramdesc-category-delim','s:39:\"Das Trennzeichen fr die Ergebniswerte\";'),('de','messages:smw-paramdesc-category-template','s:57:\"Die Vorlage, mit der die Objekte formatiert werden sollen\";'),('de','messages:smw-paramdesc-category-userparam','s:56:\"Der Parameter, der an die Vorlage bergeben werden soll\";'),('de','messages:smw-info-par-message','s:26:\"Die anzuzeigend