g an deine Benutzerkonteninformationen fr {{SITENAME}} angefordert ($4). {{PLURAL:$3|Das folgende Benutzerkonto ist|Die folgenden Benutzerkonten sind}} mit dieser E-Mail-Adresse verknpft:\n\n$2\n\n{{PLURAL:$3|Dieses temporre Passwort luft|Diese temporren Passwrter laufen}} innerhalb von {{PLURAL:$5|einem Tag|$5 Tagen}} ab. Du solltest dich anmelden und ein neues Passwort vergeben. Falls jemand anderes diese Anfrage gettigt hat oder du dich wieder an dein ursprngliches Passwort erinnern kannst und es nicht ndern mchtest, kannst du diese Nachricht ignorieren und weiterhin dein altes Passwort benutzen.\";'),('de','messages:passwordreset-emailelement','s:41:\"Benutzername: $1\nTemporres Passwort: $2\";'),('de','messages:passwordreset-emailsent','s:42:\"Eine Erinnerung wurde per E-Mail versandt.\";'),('de','messages:passwordreset-emailsent-capture','s:58:\"Die unten angezeigte Erinnerungs-E-Mail wurde abgeschickt.\";'),('de','messages:passwordreset-emailerror-capture','s:115:\"Die unten angezeigte Erinnerungs-E-Mail wurde generiert, allerdings ist der Versand an den Benutzer gescheitert: $1\";'),('de','messages:changeemail','s:22:\"E-Mail-Adresse ndern\";'),('de','messages:changeemail-header','s:22:\"E-Mail-Adresse ndern\";'),('de','messages:changeemail-text','s:143:\"Flle dieses Formular vollstndig aus, um deine E-Mail-Adresse zu ndern. Du musst dein Passwort angeben, um diese nderung zu besttigen.\";'),('de','messages:changeemail-no-info','s:73:\"Du musst angemeldet sein, um direkt auf diese Seite zugreifen zu knnen.\";'),('de','messages:changeemail-oldemail','s:24:\"Aktuelle E-Mail-Adresse:\";'),('de','messages:changeemail-newemail','s:20:\"Neue E-Mail-Adresse:\";'),('de','messages:changeemail-none','s:7:\"(keine)\";'),('de','messages:changeemail-submit','s:22:\"E-Mail-Adresse ndern\";'),('de','messages:changeemail-cancel','s:9:\"Abbrechen\";'),('de','messages:bold_sample','s:11:\"Fetter Text\";'),('de','messages:bold_tip','s:11:\"Fetter Text\";'),('de','messages:ital