R $CHANGEDORCREATED\";'),('de','messages:enotif_lastvisited','s:36:\"Alle nderungen auf einen Blick: $1\";'),('de','messages:enotif_lastdiff','s:31:\"Siehe $1 nach dieser nderung.\";'),('de','messages:enotif_anon_editor','s:20:\"Anonymer Benutzer $1\";'),('de','messages:enotif_body','s:985:\"Hallo $WATCHINGUSERNAME,\n\ndie {{SITENAME}}-Seite $PAGETITLE wurde von $PAGEEDITOR am $PAGEEDITDATE um $PAGEEDITTIME Uhr $CHANGEDORCREATED.\n\nAktuelle Version: $PAGETITLE_URL\n\n$NEWPAGE\n\nZusammenfassung des Bearbeiters: $PAGESUMMARY $PAGEMINOREDIT\n\nKontakt zum Bearbeiter:\nE-Mail: $PAGEEDITOR_EMAIL\nWiki: $PAGEEDITOR_WIKI\n\nEs werden dir solange keine weiteren Benachrichtigungs-E-Mails gesendet, bis du die Seite wieder besucht hast. Auf deiner Beobachtungsliste kannst du alle Benachrichtigungsmarkierungen zusammen zurcksetzen.\n\n             Dein freundliches {{SITENAME}}-Benachrichtigungssystem\n\n--\nUm die Einstellungen der E-Mail-Benachrichtigung anzupassen, besuche {{canonicalurl:{{#special:Preferences}}}}\n\nUm die Einstellungen deiner Beobachtungsliste anzupassen, besuche {{canonicalurl:{{#special:EditWatchlist}}}}\n\nUm die Seite von deiner Beobachtungsliste herunterzunehmen, besuche $UNWATCHURL\n\nRckmeldungen und weitere Hilfe: {{canonicalurl:{{MediaWiki:Helppage}}}}\";'),('de','messages:deletepage','s:14:\"Seite lschen\";'),('de','messages:confirm','s:11:\"Besttigen\";'),('de','messages:excontent','s:20:\"Inhalt war: $1\";'),('de','messages:excontentauthor','s:75:\"Inhalt war: $1 (einziger Bearbeiter: [[Special:Contributions/$2|$2]])\";'),('de','messages:exbeforeblank','s:41:\"Inhalt vor dem Leeren der Seite: $1\";'),('de','messages:exblank','s:14:\"Seite war leer\";'),('de','messages:delete-confirm','s:21:\"Lschen von $1\";'),('de','messages:delete-legend','s:8:\"Lschen\";'),('de','messages:historywarning','s:130:\"\'\'\'Achtung:\'\'\' Die Seite, die du lschen mchtest, hat eine Versionsgeschichte mit ungefhr $1 {{PLURAL:$1|Version|Versionen}}:\";'),('de','me