perrt.\";'),('de','messages:lockedbyandtime','s:24:\"(von $1 am $2 um $3 Uhr)\";'),('de','messages:move-page','s:24:\"Verschieben von $1\";'),('de','messages:move-page-legend','s:17:\"Seite verschieben\";'),('de','messages:movepagetext','s:1037:\"Mit untenstehendem Formular kannst du eine Seite umbenennen, indem du sie mitsamt allen Versionen auf einen neuen Titel verschiebst.\nDer alte Titel wird danach zum neuen weiterleiten.\nDu kannst Weiterleitungen, die auf den Originaltitel verlinken, automatisch korrigieren lassen.\nStelle sicher, dass du im Anschluss alle [[Special:DoubleRedirects|doppelten]] oder [[Special:BrokenRedirects|kaputten Weiterleitungen]] berprfst.\nDu bist dafr verantwortlich, dass Links weiterhin auf das korrekte Ziel verweisen.\n\nDie Seite wird \'\'\'nicht\'\'\' verschoben, sofern es bereits eine Seite mit dem vorgesehenen Titel gibt, es sei denn, diese ist leer oder eine Weiterleitung ohne Versionsgeschichte.\nDies bedeutet, dass du die Umbenennung rckgngig machen kannst, sofern du einen Fehler gemacht hast. Du kannst hingegen keine Seite berschreiben.\n\n\'\'\'Warnung!\'\'\'\nDie Verschiebung kann weitreichende und unerwartete Folgen fr hufig besuchte Seiten haben.\nDu solltest daher die Konsequenzen verstanden haben, bevor du jetzt fortfhrst.\";'),('de','messages:movepagetext-noredirectfixer','s:941:\"Mit untenstehendem Formular kannst du eine Seite umbenennen, indem du sie mitsamt allen Versionen auf einen neuen Titel verschiebst.\nDer alte Titel wird danach zum neuen weiterleiten.\nStelle sicher, dass du im Anschluss alle [[Special:DoubleRedirects|doppelten]] oder [[Special:BrokenRedirects|kaputten Weiterleitungen]] berprfst.\nDu bist dafr verantwortlich, dass Links weiterhin auf das korrekte Ziel verweisen.\n\nDie Seite wird \'\'\'nicht\'\'\' verschoben, sofern es bereits eine Seite mit dem vorgesehenen Titel gibt, es sei denn, diese ist leer oder eine Weiterleitung ohne Versionsgeschichte.\nDies bedeutet, dass du die Umbenennung rckgngig machen kannst, sofern du einen Fehler gemacht hast. Du kannst hingegen keine Seite berschreiben.\n\n\'\'\'Warnung!\'\'\'\nDie Verschiebung kann weitreichende und unerwartete Folgen fr hufig besuchte Seiten haben.\nDu solltest daher die Konsequenzen verstanden haben, bevor du jetzt fortfhrst.\";'),('de','messages:movepagetalktext','s:418:\"Die dazugehrige Diskussionsseite wird, sofern vorhanden, mitverschoben, \'\'\'es sei denn:\'\'\'\n*Es existiert bereits eine Diskussionsseite mit diesem Namen, oder\n*du whlst die unten stehende Option ab.\n\nIn diesen Fllen musst du, falls gewnscht, den Inhalt der Seite von Hand verschieben oder zusammenfhren.\n\nBitte den \'\'\'neuen\'\'\' Titel unter \'\'\'Ziel\'\'\' eintragen, darunter die Umbenennung bitte \'\'\'begrnden.\'\'\'\";'),('de','messages:movearticle','s:18:\"Seite verschieben:\";'),('de','messages:moveuserpage-warning','s:172:\"\'\'\'Warnung:\'\'\' Du bist dabei, eine Benutzerseite zu verschieben. Bitte bedenke, dass dadurch nur die Benutzerseite verschoben, \'\'\'nicht\'\'\' aber der Benutzer umbenannt wird.\";'),('de','messages:movenologin','s:24:\"Du bist nicht angemeldet\";'),('de','messages:movenologintext','s:108:\"Du musst ein registrierter Benutzer und [[Special:UserLogin|angemeldet]] sein, um eine Seite zu verschieben.\";'),('de','messages:movenotallowed','s:79:\"Du hast nicht die erforderliche Berechtigung, um Seiten verschieben zu knnen.\";'),('de','messages:movenotallowedfile','s:80:\"Du hast nicht die erforderliche Berechtigung, um Dateien verschieben zu knnen.\";'),('de','messages:cant-move-user-page','s:89:\"Du hast nicht die erforderliche Berechtigung, Benutzerhauptseiten verschieben zu knnen.\";'),('de','messages:cant-move-to-user-page','s:116:\"Du hast nicht die Berechtigung, Seiten auf eine Benutzerseite zu verschieben (mit Ausnahme von Benutzerunterseiten).\";'),('de','messages:newtitle','s:5:\"Ziel:\";'),('de','messages:move-watch','s:31:\"Quell- und Zielseite beobachten\";'),('de','messages: