','messages:confirmemail_oncreate','s:198:\"Ein Besttigungs-Code wurde an deine E-Mail-Adresse gesandt. Dieser Code wird fr die Anmeldung nicht bentigt, jedoch wird er zur Aktivierung der E-Mail-Funktionen innerhalb des Wikis gebraucht.\";'),('de','messages:confirmemail_sendfailed','s:159:\"{{SITENAME}} konnte die Besttigungs-E-Mail nicht an dich versenden.\nBitte prfe die E-Mail-Adresse auf ungltige Zeichen.\n\nRckmeldung des Mailservers: $1\";'),('de','messages:confirmemail_invalid','s:138:\"Ungltiger Besttigungscode. Mglicherweise ist der Besttigungszeitraum verstrichen. Versuche bitte, die Besttigung zu wiederholen.\";'),('de','messages:confirmemail_needlogin','s:57:\"Du musst dich $1, um deine E-Mail-Adresse zu besttigen.\";'),('de','messages:confirmemail_success','s:103:\"Deine E-Mail-Adresse wurde erfolgreich besttigt. Du kannst dich jetzt [[Special:UserLogin|anmelden]].\";'),('de','messages:confirmemail_loggedin','s:50:\"Deine E-Mail-Adresse wurde erfolgreich besttigt.\";'),('de','messages:confirmemail_error','s:63:\"Es gab einen Fehler bei der Besttigung deiner E-Mail-Adresse.\";'),('de','messages:confirmemail_subject','s:46:\"[{{SITENAME}}] Besttigung der E-Mail-Adresse\";'),('de','messages:confirmemail_body','s:687:\"Hallo,\n\njemand mit der IP-Adresse $1, wahrscheinlich du selbst, hat das Benutzerkonto $2 in {{SITENAME}} registriert.\n\nUm die E-Mail-Funktion von {{SITENAME}} (wieder) zu aktivieren und um zu besttigen,\ndass dieses Benutzerkonto wirklich zu deiner E-Mail-Adresse und damit zu dir gehrt, ffne bitte die folgende Web-Adresse:\n\n$3\n\nSollte die vorstehende Adresse in deinem E-Mail-Programm ber mehrere Zeilen gehen, musst du sie eventuell per Hand in die Adresszeile deines Web-Browsers einfgen.\n\nWenn du das genannte Benutzerkonto *nicht* registriert hast, folge diesem Link, um den Besttigungsprozess abzubrechen:\n\n$5\n\nDieser Besttigungscode ist gltig bis $6, $7 Uhr.\";'),('de','messages:confirmemail_body_changed','s:476:\"Jemand mit der IP-Adresse $1, wahrscheinlich du selbst,\nhat die E-Mail-Adresse des Benutzerkontos $2 zu dieser Adresse auf {{SITENAME}} gendert.\n\nUm zu besttigen, dass dieses Benutzerkonto wirklich dir gehrt\nund um die E-Mail-Features auf {{SITENAME}} zu reaktivieren, ffne diesen Link in deinem Browser:\n\n$3\n\nFalls das Konto *nicht* dir gehrt, folge diesem Link,\num die E-Mail-Adress-Besttigung abzubrechen:\n\n$5\n\nDieser Besttigungscode ist gltig bis $4.\";'),('de','messages:confirmemail_body_set','s:535:\"Jemand mit der IP-Adresse $1, wahrscheinlich du selbst,\nhat die E-Mail-Adresse des Benutzerkontos $2 auf {{SITENAME}} zu dieser E-Mail-Adresse abgendert.\n\nUm zu besttigen, dass dieses Benutzerkonto wirklich zu dir gehrt\nund um die E-Mail-Funktionen auf {{SITENAME}} wieder zu aktivieren, ffne bitte den folgenden Link in deinem Browser:\n\n$3\n\nFalls das Konto *nicht* zu dir gehrt, bitte den nachfolgenden Link ffnen,\num die Besttigung der E-Mail-Adresse abzubrechen:\n\n$5\n\nDieser Besttigungscode ist gltig bis $4.\";'),('de','messages:confirmemail_invalidated','s:35:\"E-Mail-Adressbesttigung abbrechen\";'),('de','messages:invalidateemail','s:35:\"E-Mail-Adressbesttigung abbrechen\";'),('de','messages:scarytranscludedisabled','s:38:\"[Interwiki-Einbindung ist deaktiviert]\";'),('de','messages:scarytranscludefailed','s:44:\"[Vorlageneinbindung fr $1 ist gescheitert]\";'),('de','messages:scarytranscludetoolong','s:17:\"[URL ist zu lang]\";'),('de','messages:deletedwhileediting','s:261:\"Achtung: Diese Seite wurde gelscht, nachdem du angefangen hast sie zu bearbeiten!\nIm [{{fullurl:{{#special:Log}}|type=delete&page={{FULLPAGENAMEE}}}} Lsch-Logbuch] findest du den Grund fr die Lschung. Wenn du die Seite speicherst, wird sie neu angelegt.\";'),('de','messages:confirmrecreate','s:231:\"Benutzer [[User:$1|$1]] ([[User talk:$1|Diskussion]]) hat diese Seite gelscht, nachdem du angefangen hast, sie zu bearbeiten. Die Begrndung lautete:\n:\'\'$2\'\'\nBitte besttige, dass du 